import React, { useContext } from 'react'
import './CartItem.css';
import {ShopContext} from '../../Context/ShopContext'
import remove_icon from '../Assets/cart_cross_icon.png';
import {loadStripe} from '@stripe/react-stripe-js';
export const CartItems = () => {
    const {getTotalCartAmount, all_product, cartItems, removefromcart} = useContext(ShopContext)

    const makepayment = async()=>{
        const stripe = await loadStripe(process.env.E_COMMERCE_PUBLISHABLE_KEY);

        const body = {
            products:all_product
        }
        const headers = {
            "Content-type": "application/json"
        }
        const response = await fetch(`${apiURL}/create-checkout-session`,{
            method:"POST",
            headers:headers,
            body:JSON.stringify(body)
        })

        const session = await response.json;
        const result = stripe.redirectToCheckout({
            sessionId:session.id
        });
        if(result.error){
            console.log(result.error);
        }
    }
  return (
    <div className='cartitems'>
        <div className="cartitems-format-main">
            <p>Products</p>
            <p>Title</p>
            <p>Price</p>
            <p>Quantity</p>
            <p>Total</p>
            <p>Remove</p>    
        </div> 
        <hr />
        {all_product.map((e)=>{
            if(cartItems[e.id]>0)
            {
                return <div>
                            <div className="cartitems-format cartitems-format-main">
                                <img className='carticon-product-icon' src={e.image} alt="" />
                                <p>{e.name}</p>
                                <p>${e.new_price}</p>
                                <button className='cartitems-quantity'>{cartItems[e.id]}</button>
                                <p>${e.new_price * cartItems[e.id]}</p>
                                <img className='carticon-remove-icon' src={remove_icon} alt="" onClick={()=>{removefromcart(e.id)}}/>
                
                            </div>
                            <hr />    
                        </div> 
            }
            return null;
        })}  
        <div className="cartitems-down">
            <div className="cartitems-total">
                <h1>Cart Total</h1>
                <div>
                    <div className="cartitems-total-items">
                        <p>Subtotal</p>
                        <p>${getTotalCartAmount()}</p>
                    </div>
                    <hr />
                    <div className="cartitems-total-items">
                        <p>Shipping Fee</p>
                        <p>Free</p>
                    </div>
                    <hr />
                    <div className="cartitems-total-items">
                        <h3>Total</h3>
                        <h3>${getTotalCartAmount()}</h3>
                    </div>
                </div>
                <button onClick={makepayment}>PROCEED TO CHECKOUT</button>
            </div>
            <div className="cartitems-promocode">
                <p>If you ave a promo code enter it here</p>
                <div className="cartitems-promobox">
                    <input type="text" placeholder='promo code'/>
                    <button>Submit</button>
                </div>
            </div>
        </div>
    </div>
  )
}
